// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./ERC721A.sol";
import "./Ownable.sol";
import "./Counters.sol";
import "./ERC721URIStorage.sol";
import "./IERC721Receiver.sol";

contract NFTErc721a is ERC721URIStorage, IERC721Receiver, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private tokenIdCount;

    using Strings for uint256;
    uint256 public tokenId;
    uint256 public totalNFTSupply;
    string public _tokenURI;
    bool public isRevealed;
    address contractAddress;
    
    

    mapping (uint256 => string) private _tokenURIs;

    constructor(address marketplaceAddress, uint256 _maxBatchSize)
        ERC721A("NFT Trader", "NFTT", _maxBatchSize)
    {
        contractAddress = marketplaceAddress;
        
    }


    //Mint NFTs
    function mintNFTToken(address contractAddress,
        uint256 quantity,
        bytes memory data, string memory tokenURI_)
        public
        returns (uint256)
    {
        uint256 id = tokenIdCount.current();
        tokenIdCount.increment(); 
        _safeMint(contractAddress, quantity,data);
        totalNFTSupply = totalNFTSupply + quantity;
        _setTokenURI(id, tokenURI_);
        setApprovalForAll(contractAddress, true);
        return id ;
    }


//    function _setTokenURI(uint256 _tokenId, string memory token_URI) public {
//         require(_exists(_tokenId), "ERC721URIStorage: URI set of nonexistent token");
//         _tokenURIs[_tokenId] = token_URI;
//     }
   function setTokenURI(uint256 _tokenId, string memory token_URI) public {
        _setTokenURI(_tokenId, token_URI);
    }

    // // setting url by forloop
    // uint setCounter=0;
    // function mintNFTToken2(address contractAddress,
    //     uint256 quantity,
    //     bytes memory data,
    //     string memory tokenURI_)
    //     public
    //     returns (uint256)
    // {
    //     setCounter+=quantity;
    //     uint256 id = tokenIdCount.current();
    //     tokenIdCount.increment(); 
    //     _safeMint(contractAddress, quantity,data);
    //     totalNFTSupply = totalNFTSupply + quantity;

    //     for(uint i=setCounter;i<quantity;quantity++){
    //     _setTokenURI(i, tokenURI_);
    //     }
        
    //     setApprovalForAll(contractAddress, true);
    //     return id ;
    // }

    //Mint NFTs
    function createNFTtoken(
        address to,
        uint256 quantity,
        bytes memory _data
    ) public returns (uint256) {
        _safeMint(to, quantity, _data);
        totalNFTSupply = totalNFTSupply + quantity;
        setApprovalForAll(contractAddress, true);
        return tokenId;
    }

    //Get TotalSupply of NFT
    function getTotalSupply() public view returns (uint256) {
        return totalNFTSupply;
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
